define({"topics" : [{"title":"File Name Pattern and Mode","shortdesc":"\n               <p class=\"shortdesc\">Use a file name pattern to define the files that the Directory origin processes. <span class=\"ph\">You can use either a glob pattern or a regular expression to define                 the file name pattern. </span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_xd5_5z4_4y","attributes": {"data-id":"concept_xd5_5z4_4y",},"menu": {"hasChildren":false,},"tocID":"concept_xd5_5z4_4y-d46e54733","topics":[]},{"title":"Read Order","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_b4d_fym_xv","attributes": {"data-id":"concept_b4d_fym_xv",},"menu": {"hasChildren":false,},"tocID":"concept_b4d_fym_xv-d46e54760","topics":[]},{"title":"Multithreaded Processing","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_pcl_nwn_qbb","attributes": {"data-id":"concept_pcl_nwn_qbb",},"menu": {"hasChildren":false,},"tocID":"concept_pcl_nwn_qbb-d46e54792","topics":[]},{"title":"Reading from Subdirectories","shortdesc":"\n               <p class=\"shortdesc\">When using the Last Modified Timestamp read order, the Directory origin can read         files in subdirectories of the specified\n                  file directory. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_qpt_rg3_cy","attributes": {"data-id":"concept_qpt_rg3_cy",},"menu": {"hasChildren":true,},"tocID":"concept_qpt_rg3_cy-d46e54834","next":"concept_qpt_rg3_cy-d46e54834",},{"title":"First File for Processing","shortdesc":"\n               <p class=\"shortdesc\">Configure a first file for processing when you want Directory to ignore one or                 more existing files in the\n                  directory.\n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_ltv_r3l_5q","attributes": {"data-id":"concept_ltv_r3l_5q",},"menu": {"hasChildren":false,},"tocID":"concept_ltv_r3l_5q-d46e54955","topics":[]},{"title":"Late Directory","shortdesc":"\n               <p class=\"shortdesc\">You can configure the <span class=\"ph\">Directory</span> origin to read files in a late         directory - a directory that appears after the pipeline starts. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_p52_xj1_4v","attributes": {"data-id":"concept_p52_xj1_4v",},"menu": {"hasChildren":false,},"tocID":"concept_p52_xj1_4v-d46e55031","topics":[]},{"title":"Record Header Attributes","shortdesc":"\n               <p class=\"shortdesc\">The Directory origin <span class=\"ph\">creates record header                 attributes that include <span class=\"ph\">information about the originating file for                     the record</span>.</span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_tlj_3g1_2z","attributes": {"data-id":"concept_tlj_3g1_2z",},"menu": {"hasChildren":false,},"tocID":"concept_tlj_3g1_2z-d46e55134","topics":[]},{"title":"Event Generation","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_ttg_vgn_qx","attributes": {"data-id":"concept_ttg_vgn_qx",},"menu": {"hasChildren":true,},"tocID":"concept_ttg_vgn_qx-d46e55249","next":"concept_ttg_vgn_qx-d46e55249",},{"title":"Buffer Limit and Error Handling","shortdesc":"\n               <p class=\"shortdesc\">The Directory origin <span class=\"ph\">passes each record to a buffer. The size of the buffer determines                 the maximum size of the record that can\n                     be processed. Decrease the buffer limit when                 memory on the <span class=\"ph\">Data Collector</span>                 machine is limited. Increase the buffer limit to process larger records when memory                 is available.</span>   \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_zp2_fqs_5r","attributes": {"data-id":"concept_zp2_fqs_5r",},"menu": {"hasChildren":false,},"tocID":"concept_zp2_fqs_5r-d46e55493","topics":[]},{"title":"Data Formats","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_gz5_dqw_yq","attributes": {"data-id":"concept_gz5_dqw_yq",},"menu": {"hasChildren":false,},"tocID":"concept_gz5_dqw_yq-d46e55639","topics":[]},{"title":"Configuring a Directory Origin","shortdesc":"\n               <p class=\"shortdesc\">Configure a Directory origin to read data from files in a directory. </p>\n            ","href":"datacollector\/UserGuide\/Origins\/Directory.html#task_o5v_bp1_n3b","attributes": {"data-id":"task_o5v_bp1_n3b",},"menu": {"hasChildren":false,},"tocID":"task_o5v_bp1_n3b-d46e55787","topics":[]}]});